import React from 'react';
import Header from "../../helpers/Headers";
import Text from "../../helpers/Text";

function Reviews(props) {
    return (
        <div className="body">
            <Header/>
            <Text text="Отзывы клиентов" center="center"></Text>
        </div>
    );
}

export default Reviews;
